INSERT INTO `option` VALUES (1,'web_name','座位预约系统'),(2,'web_url','http://127.0.0.1/'),(3,'max_hour','4'),(4,'open_time','6:00'),(5,'close_time','23:50'),(6,'announce','<p>        为了加强图书馆智能化管理水平，维护读者在图书馆平等利用阅览座位的权益，防止抢座、占座和入馆拥挤等不良现象的发生，图书馆采取座位管理系统来规范和维护阅览秩序。以下为管理系统操作流程及规则：<br />\\r\\n        电脑派位采用读者自选和随机派发两种方式，读者可任选一种。<br />\\r\\n        电脑派位时间：7:00 --- 22:30。当晚19:30开放次日座位预约，可在网页、微信、APP预约座位。<br />\\r\\n        每次预约座位时长0.5～4小时，距结束60分钟内，可续座0.5～2小时。<br />\\r\\n        签到时间：必须在预选时间之前30分钟内及预选时间之后15分钟之内到图书馆进行签到（现场选座无需签到）。<br />\\r\\n        “暂时离开”阅览室时，请在触屏机上刷卡，“暂离”时座位保留30分钟。超时视为放弃座位，系统收回。30分钟内返回请在触屏机上刷卡，系统将自动恢复原座位。<br />\\r\\n        如需离开阅览室超过30分钟，请在触屏机上刷卡时选择“结束使用”，原座位重新进入派位。<br />\\r\\n       餐时( 11:00--12:30 ；17:00--18:30)刷卡“暂离”，系统保留90分钟。<br />\\r\\n        如果读者有三次违规操作，系统会自动列入黑名单，取消派位资格7天。以下情况属于违规操作：1）读者离开座位但未释放；2）读者选择“暂离”但未在规定时间内返回并恢复座位；3）读者预约座位却未在规定时间内签到。<br />\\r\\n        触屏机使用说明：在屏幕下方刷卡区刷卡，即可进行预约选座。<br />\\r\\n        手机客户端：请登录http://seatlib.hpu.edu.cn，扫码下载（或者直接扫描二维码下载）。安装后首先设置服务器地址：seatlib.hpu.edu.cn，然后输入学号和密码登陆。<\\/p>'),(7,'time_out','150');
